INSERT INTO `template` VALUES (599,'2.16.840.1.113883.10.20.22.1.1',-1,'Consolidated US Realm Header',1,'US Realm Header','header',28,NULL,NULL,'2011-04-07 17:09:35','defaultUser'),(605,'2.16.840.1.113883.10.20.22.2.7.1',-1,'Procedures Section (entries required)',2,'This section defines all interventional, surgical, diagnostic, or therapeutic procedures or treatments pertinent to the patient historically at the time the document is generated. The section may contain all procedures for the period of time being summarized, but should include notable procedures.  The common notion of â€œprocedureâ€� is broader than that specified by the HL7 Version 3 Reference Information Model (RIM). Therefore this section contains procedure templates represented with three RIM classes Act: Observation and Procedure.  Procedure act is for procedures the alter that physical condition of a patient (Splenectomy).  Observation act is for procedures that result in new information about a patient but do not cause physical alteration (EEG). Act is for all other types of procedures (dressing change).','CONS, Procedures',94,NULL,NULL,'2011-04-08 02:38:55','defaultUser'),(606,'2.16.840.1.113883.10.20.22.2.3.1',-1,'Results Section (required entries)',2,'This is Results Section, From the CDA Consolidation Project','Consolidated , CONSO',30,613,NULL,'2011-04-06 18:23:22','defaultUser'),(607,'2.16.840.1.113883.10.20.22.2.4.1',-1,'Vital Signs (required entries)',2,'This is the vital signs section, coming out of the CDA Consolidation Project','Consolidation, CONSO, vital signs',30,618,NULL,'2011-04-06 18:24:02','defaultUser'),(608,'2.16.840.1.113883.10.20.22.2.6.1',-1,'Allergies, Adverse Reactions, Alerts Section (entries required)',2,'The Allergies section lists and describes any medication allergies, adverse reactions, idiosyncratic reactions, anaphylaxis/anaphylactoid reactions to food items, and metabolic variations or adverse reactions/allergies to other substances (such as latex, iodine, tape adhesives) used to assure the safety of health care delivery. At a minimum, it should list currently active and any relevant historical allergies and adverse reactions. In general the Allergies section should not include environmental allergies, even if severe and directly related to the presenting problem, since they constitute a medical problem; environmental allergies should be listed in the problem list and past medical history.','CONS, Allergy, adverse event, allergy',94,NULL,NULL,'2011-04-07 00:22:33','defaultUser'),(609,'2.16.840.1.113883.10.20.22.2.7',-1,'Procedure section (optional entries)',2,'Consolidated procedure section',NULL,94,NULL,'notes - blah blah blah','2011-04-08 08:26:03','defaultUser'),(610,'2.16.840.1.113883.10.20.22.4.16',-1,'Medication Activity',3,'A medication activity describes substance administrations that have actually occurred (e.g. pills ingested or injections given) or are intended to occur (e.g. \"take 2 tablets twice a day for the next 10 days\"). Medication activities in â€œINTâ€� mood are reflections of what a clinician intends a patient to be taking. Medication activities in â€œEVNâ€� mood reflect actual use.\r\nMedication timing is complex. This template requires that there be a substanceAdministration/effectiveTime valued with a time interval, representing the start and stop dates. Additional effectiveTime elements are optional, and can be used to represent frequency and other aspects of more detailed dosing regimens.','Medications',103,NULL,NULL,'2011-04-06 17:51:46','defaultUser'),(611,'2.16.840.1.113883.10.20.22.2.5.1',-1,'Consolidated Problems Section',2,NULL,'Problems',30,NULL,'Created by Deloitte. Needs QA.','2011-04-06 19:29:31','defaultUser'),(613,'2.16.840.1.113883.10.20.22.2.3',-1,'Results Section (optional entries)',2,'Results section, optional entries, from the CDA Consolidation Project','Consolidation, Conso',30,NULL,NULL,'2011-04-06 18:16:30','defaultUser'),(614,'2.16.840.1.113883.10.20.22.4.1',-1,'Result Organizer',3,'Consolidated Results Organizer','Consolidation, Conso',66,NULL,NULL,'2011-04-06 18:50:51','defaultUser'),(615,'2.16.840.1.113883.10.20.22.4.2',-1,'Result Observation',3,NULL,'Consolidation, Conso',64,NULL,NULL,'2011-04-06 18:50:13','defaultUser'),(616,'2.16.840.1.113883.10.20.22.5.1',-1,'Consolidated US Realm Header Name',5,'Reusable \"name\" template, designed for use in US Realm CDA Header.',NULL,62,NULL,NULL,'2011-04-07 17:55:59','defaultUser'),(618,'2.16.840.1.113883.10.20.22.2.4',-1,'Vital Signs Section (optional entries)',2,'Consolidated Vital Signs Section','Consolidation, CONSO, vital signs',30,NULL,NULL,'2011-04-06 18:24:35','defaultUser'),(619,'2.16.840.1.113883.10.20.22.4.26',-1,'Vital Signs Organizer',3,'Consolidation Vital Signs Organizer, conformant to Consolidated Results Organizer but further constrained','Consolidation, CONSO, vital signs',66,NULL,NULL,'2011-04-06 18:52:55','defaultUser'),(620,'2.16.840.1.113883.10.20.22.5.2',-1,'Consolidated US Realm Header Address',5,'Reusable \"address\" template, designed for use in US Realm CDA Header.','medications',13,NULL,NULL,'2011-04-07 17:55:54','defaultUser'),(621,'2.16.840.1.113883.10.20.22.4.27',-1,'Vital Sign Observation',3,'Consolidated Vital Signs Observation, Further constrained from Results observation','Consolidation, CONSO, vital signs',64,NULL,NULL,'2011-04-06 18:52:37','defaultUser'),(622,'2.16.840.1.113883.10.20.22.4.28',-1,'Alert Status Observation',3,'This template represents the status of the allergy or alert indicating whether it is active, no longer active or is an historic allergy or alert.  There can be only one alert status observation per alert/allergy observation.','CONS, Allergy',64,NULL,NULL,'2011-04-06 18:54:44','defaultUser'),(623,'2.16.840.1.113883.10.20.22.4.9',-1,'Reaction Observation',3,'This clinical statement represents an undesired symptom, finding, etc, due to an administered or exposed substance.  A reaction can be defined with respect to its severity, and can have been treated by one or more interventions','CONS, Allergy, medication',64,NULL,NULL,'2011-04-07 02:17:23','defaultUser'),(624,'2.16.840.1.113883.10.20.22.4.8',-1,'Severity Observation',3,'This clinical statement represents the degree of severity of a related observation. It can be used to represent the severity of an allergic reaction, the severity of a condition, etc.','CONS, Allergy, medication',64,NULL,NULL,'2011-04-07 02:28:24','defaultUser'),(625,'2.16.840.1.113883.10.20.22.4.6',-1,'Problem Status',3,'This clinical statement represents the status of a patient problem.  Typical values are â€œActiveâ€�, â€œInactiveâ€� and â€œResolvedâ€�.   A resolved problem no longer exists as a problem for the patient as of the time of recording (it may reoccur, but that would be a new instance).  An inactive problem is one that still exists for the patient but is not currently a cause for concern (e.g., diabetes that is under control).  An active problem exists and is a current cause for concern.  A problem status observation will always refer to and be contained in a single problem observation.','CONS, allergy, problem',64,NULL,NULL,'2011-04-06 18:49:24','defaultUser'),(627,'2.16.840.1.113883.10.20.22.4.25',-1,'Precondition for Substance Administration',3,'A criterion for administration can be used to record that the medication is to be administered only when the associated criteria are met.','medication',229,NULL,NULL,'2011-04-06 18:48:59','defaultUser'),(629,'2.16.840.1.113883.10.20.22.4.7',-1,'Allergy/Alert Observation',3,'This clinical statement represents that an allergy or adverse reaction exists or does not exist.  The agent that is the cause of the allergy or adverse reaction is represented as a manufactured material participant playing entity in the allergy observation.  While the agent is often implicit in the alert observation (e.g. â€œallergy to penicillinâ€�), it should also be asserted explicitly as an entity.','CONS, Allergy',64,NULL,NULL,'2011-04-06 18:55:43','defaultUser'),(630,'2.16.840.1.113883.10.20.22.4.20',-1,'Instructions',3,'The Instructions template can be used in several ways, such as to record patient instructions within a Medication Activity or to record fill instructions within a supply order. The Act/code defines the type of instruction (e.g. code=\"311401005\" codeSystem=\"2.16.840.1.113883.6.96\" displayName=\"patient instruction\").','medications',12,NULL,NULL,'2011-04-06 18:46:22','defaultUser'),(631,'2.16.840.1.113883.10.20.22.4.23',-1,'Medication Information',3,'The medication can be recorded as a precoordinated product strength, product form, or product concentration (e.g. \"metoprolol 25mg tablet\", \"amoxicillin 400mg/5mL suspension\"); or not pre-coordinated (e.g. \"metoprolol product\").','medications',60,NULL,NULL,'2011-04-06 18:47:09','defaultUser'),(632,'2.16.840.1.113883.10.20.22.4.17',-1,'Medication Supply Order',3,NULL,'medications',232,NULL,NULL,'2011-04-06 18:48:20','defaultUser'),(633,'2.16.840.1.113883.10.20.22.4.18',-1,'Medication Dispense',3,NULL,'medications',232,NULL,NULL,'2011-04-06 18:46:31','defaultUser'),(634,'2.16.840.1.113883.10.20.22.4.30',-1,'Allergy Problem Act',3,'This clinical statement act represents a concern relating to a patientâ€™s allergies or adverse events.  A concern is a term used when referring to patientâ€™s problems that are related to one another.  Observations of problems or other clinical statements captured at a point in time are wrapped in a \"Concern\" act which represents the ongoing process tracked over time.  This outer allergy problem act (representing the â€œConcernâ€�) can contain nested problem observations or other nested clinical statements relevant to the allergy concern.','CONS, allergy, problem',12,NULL,NULL,'2011-04-06 18:55:02','defaultUser'),(635,'2.16.840.1.113883.10.20.22.4.19',-1,'Indication',3,'The Indication Observation documents the rationale for an activity. It can do this with the id element to reference a problem recorded elsewhere in the document or with a code and value to record the problem type and problem within the Indication. For example, the indication for a prescription of a painkiller might be a headache that is documented in the Problems Section.','medications',64,NULL,NULL,'2011-04-06 18:46:00','defaultUser'),(636,'2.16.840.1.113883.10.20.22.4.24',-1,'Drug vehicle',3,'This template represents the vehicle (e.g. saline, dextrose) for administering a medication.','medications',70,NULL,NULL,'2011-04-06 18:44:12','defaultUser'),(637,'2.16.840.1.113883.10.20.22.4.14',-1,'Procedure Activity Procedure',3,'This clinical statement represents procedures whose immediate and primary outcome (post-condition) is the alteration of the physical condition of the patient.  Examples of these procedures are an appendectomy, hip replacement and a creation of a gastrostomy.','CONS, Procedure, PROC',79,NULL,NULL,'2011-04-06 18:49:47','defaultUser'),(638,'2.16.840.1.113883.10.20.22.4.29',-1,'Medication Use - None Known',3,'This template indicates that the subject is not known to be on any medications.','medications',64,NULL,NULL,'2011-04-06 18:48:27','defaultUser'),(639,'2.16.840.1.113883.10.20.22.2.1.1',-1,'Medications Section (required entries)',2,'The Medications section defines a patientâ€™s current medications and pertinent medication history. At a minimum, the currently active medications are to be listed, with an entire medication history as an option. The section may also include a patientâ€™s prescription and dispense history.\r\nThis section requires that there be either an entry indicating the subject is not known to be on any medications, or that there be entries summarizing the subject\'s medications.','medications',94,670,NULL,'2011-04-07 06:06:37','defaultUser'),(642,'2.16.840.1.113883.10.20.22.1.9',-1,'Progress Note',1,'Add text on Progress Note.','Conso, Consolidation',28,599,NULL,'2011-04-06 18:18:20','defaultUser'),(645,'2.16.840.1.113883.10.20.22.4.31',-1,'Age Observation',3,'This clinical statement represents  an age observation.  This age observation can be for representing the patient age or it can be nested in an observation about a person related to the patient.','CONS, age',64,NULL,NULL,'2011-04-06 23:29:08','defaultUser'),(646,'2.16.840.1.113883.10.20.22.1.10',-1,'Unstructured Document',1,'In many environments much of the patient record is still captured in an unstructured format that is encapsulated within an image file or as unstructured text in an electronic file such as a word processing or Portable Document Format (PDF) documents. The Unstructured Document (UD) document type supports these in two ways: it can include unstructured content, such as a graphic, directly in a text element with a mediaType attribute, or reference a single document file, such as a word-proccesing document, using a text/reference element.',NULL,28,599,'In the template introduction, add IG Sections 4.1, 4.2, 4.3, and the explanations of the individual constraints.\r\nValue set  - Supported File Formats','2011-04-06 18:03:24','defaultUser'),(647,'2.16.840.1.113883.10.20.22.4.32',-1,'Service Delivery Location',3,'This clinical statement represents the location of a service event where an act, observation or procedure took place.','CONS, encounter, location',70,NULL,NULL,'2011-04-07 05:04:34','defaultUser'),(649,'2.16.840.1.113883.10.20.22.4.3',-1,'Condition',3,'(placeholder for MDHT output)',NULL,12,NULL,NULL,'2011-04-06 18:57:02','defaultUser'),(650,'2.16.840.1.113883.10.20.22.4.4',-1,'Condition Entry',3,'(placeholder for MDHT output)',NULL,64,NULL,NULL,'2011-04-06 18:59:00','defaultUser'),(653,'2.16.840.1.113883.10.20.22.4.33',-1,'Discharge diagnosis',3,'Discharge diagnosis entry','admission discharge context',12,NULL,NULL,'2011-04-06 18:43:37','defaultUser'),(654,'2.16.840.1.113883.10.20.22.4.34',-1,'Admission diagnosis',3,'Admission diagnosis entry','admission discharge context',12,NULL,NULL,'2011-04-06 18:53:13','defaultUser'),(655,'2.16.840.1.113883.10.20.22.4.35',-1,'Discharge medication',3,'Discharge medication entry','context',12,NULL,NULL,'2011-04-06 16:56:10','defaultUser'),(656,'2.16.840.1.113883.10.20.22.4.36',-1,'Admission medication',3,'Admission medication','admission discharge context',12,NULL,NULL,'2011-04-06 18:53:38','defaultUser'),(658,'2.16.840.1.113883.10.20.22.2.8',-1,'Assessments Section',2,'The Assessment section (also called impression or diagnoses) represents the clinicianâ€™s conclusions and working assumptions that will guide treatment of the patient. The assessment formulates a specific plan or set of recommendations. The assessment may be a list of specific disease entities or a narrative block.',NULL,94,NULL,NULL,'2011-04-06 18:39:13','defaultUser'),(663,'2.16.840.1.113883.10.20.22.2.9',-1,'Assessment and Plan Section',2,'The Assessment and Plan sections may be combined or separated to meet local policy requirements.\r\n\r\nThe Assessment section (also called impression or diagnoses) represents the clinicianâ€™s conclusions and working assumptions that will guide treatment of the patient. The assessment formulates a specific plan or set of recommendations. The assessment may be a list of specific disease entities or a narrative block.\r\nThe Plan section contains data that defines pending orders, interventions, encounters, services, and procedures for the patient. It is limited to prospective, unfulfilled, or incomplete orders and requests only. All active, incomplete, or pending orders, appointments, referrals, procedures, services, or any other pending event of clinical significance to the current care of the patient should be listed unless constrained due to privacy issues. The plan may also contain information about ongoing care of the patient and information regarding goals and clinical reminders. Clinical reminders are placed here to provide prompts for disease prevention and management, patient safety, and health-care quality improvements, including widely accepted performance measures. The plan may also indicate that patient education was given or will be provided.','Consolidation, CONSO',94,NULL,NULL,'2011-04-06 18:38:39','defaultUser'),(664,'2.16.840.1.113883.10.20.22.2.10',-1,'Plan Section',2,'The Plan section contains data that defines pending orders, interventions, encounters, services, and procedures for the patient. It is limited to prospective, unfulfilled, or incomplete orders and requests only. All active, incomplete, or pending orders, appointments, referrals, procedures, services, or any other pending event of clinical significance to the current care of the patient should be listed unless constrained due to privacy issues. The plan may also contain information about ongoing care of the patient and information regarding goals and clinical reminders. Clinical reminders are placed here to provide prompts for disease prevention and management, patient safety, and health-care quality improvements, including widely accepted performance measures. The plan may also indicate that patient education was given or will be provided.','Consolidation, CONSO',94,NULL,NULL,'2011-04-07 19:27:30','defaultUser'),(669,'2.16.840.1.113883.10.20.22.4.37',-1,'Product Instance',3,'This clinical statement represents a particular device that was placed in or used as part of a procedure or other act.  This is used to have a record of the identifier and other details about the given product that was used.  For example, it is important to have a record that indicates not just that a hip prostheses was placed in patient but that it was a particular hip prostheses number  with a unique identifier.','CONS, product instance, procedure',70,NULL,NULL,'2011-04-07 05:36:14','defaultUser'),(670,'2.16.840.1.113883.10.20.22.2.1',-1,'Medications Section (optional entries)',2,'same as required.','Consolidation, CONSO',94,NULL,NULL,'2011-04-06 16:57:37','defaultUser'),(671,'2.16.840.1.113883.10.20.22.2.6',-1,'Allergies, Adverse Reactions, Alerts Section (entries optional)',2,'see required descriptoin','Consolidation, CONSO, allergy',94,NULL,NULL,'2011-04-07 00:21:58','defaultUser'),(678,'2.16.840.1.113883.10.20.22.2.11',-1,'Hospital Discharge Medications Section (optional entries)',2,'copy from final doc','Consolidation, CONSO',94,NULL,NULL,'2011-04-06 16:48:23','defaultUser'),(679,'2.16.840.1.113883.10.20.22.2.11.1',-1,'Hospital Discharge Medications Section (required entries)',2,'DO NOT INCLUDE IN CONSOLIDATION GUIDE. NO REQUIREMENT for REQUIRED ENTRIES','consolidation, CONSO',94,NULL,'DO NOT INCLUDE IN CONSOLIDATION GUIDE. NO REQUIREMENT for REQUIRED ENTRIES','2011-04-06 18:11:42','defaultUser'),(682,'2.16.840.1.113883.10.20.22.2.12',-1,'Reason for Visit Section',2,'copy back from Consolidation','Consolidation, CONSO',30,NULL,NULL,'2011-04-06 18:00:21','defaultUser'),(684,'2.16.840.1.113883.10.20.22.2.13',-1,'Chief Complaint and Reason for Visit Section',2,'copy from conso','Consolidation, CONSO',94,NULL,NULL,'2011-04-06 15:43:23','defaultUser'),(685,'1.3.6.1.4.1.19376.1.5.3.1.3.1',-1,'Reason for Referral Section',2,'copy from guide','Consolidation, CONSO',94,NULL,NULL,'2011-04-06 15:43:16','defaultUser'),(686,' 1.3.6.1.4.1.19376.1.5.3.1.3.4',-1,'History of Present Illness Section',2,'copy from guide','Conso, Consolidation',94,NULL,NULL,'2011-04-06 15:44:42','defaultUser'),(690,'2.16.840.1.113883.10.20.22.2.5',-1,'Problem List Section',2,'grab from guide','Consolidation, CONSO',94,NULL,NULL,'2011-04-06 19:31:01','defaultUser'),(692,'2.16.840.1.113883.10.20.22.2.16',-1,'Hospital Discharge Studies Summary Section',2,'copy back from IG','Consolidation, CONS',94,NULL,NULL,'2011-04-07 02:02:06','defaultUser'),(693,'2.16.840.1.113883.10.20.22.2.2',-1,'Immunizations Section',2,'copy back from guide','Consolidation, CONSO',94,NULL,NULL,'2011-04-07 02:03:03','defaultUser'),(697,'2.16.840.1.113883.10.20.22.2.14',-1,'Functional Status Section',2,'copy back from guide','conso, consolidation',94,NULL,NULL,'2011-04-07 02:11:14','defaultUser'),(698,'2.16.840.1.113883.10.20.22.2.18',-1,'Payers Section',2,'copy back from guide','consolidation, conso',94,NULL,NULL,'2011-04-07 02:12:16','defaultUser'),(699,'2.16.840.1.113883.10.20.22.2.21',-1,'Advance Directives Section',2,'copy back from IG','consolidation, CONSO',94,NULL,NULL,'2011-04-07 02:13:17','defaultUser'),(700,'2.16.840.1.113883.10.20.22.2.15',-1,'Family History Section',2,'copy back from guide','consolidation, conso',94,NULL,NULL,'2011-04-07 02:14:28','defaultUser'),(701,'2.16.840.1.113883.10.20.22.2.17',-1,'Social History Section',2,'copy back from guide','consolidation, conso',94,NULL,NULL,'2011-04-07 02:15:30','defaultUser'),(702,'2.16.840.1.113883.10.20.22.2.22',-1,'Encounters Section',2,'copy back from guide','consolidation, CONSO',94,NULL,NULL,'2011-04-07 02:16:24','defaultUser'),(703,'2.16.840.1.113883.10.20.22.2.23',-1,'Medical Equipment Section',2,'copy back from guide','consolidation, CONSO',94,NULL,NULL,'2011-04-07 02:18:11','defaultUser'),(706,'2.16.840.1.113883.10.20.22.2.24',-1,'Hospital Discharge Diagnosis Section',2,'copy back from guide','consolidation, CONSO',94,NULL,NULL,'2011-04-07 02:49:05','defaultUser'),(708,'2.16.840.1.113883.10.20.22.4.12',-1,'Procedure Activity Act',3,'This clinical statement represents any procedure that cannot be classified as an observation or a procedure according to the HL7 RIM.  Examples  of these procedures are a dressing change, teaching or feeding a patient or providing comfort measures.','cons, procedure',12,NULL,NULL,'2011-04-07 18:13:14','defaultUser'),(709,'2.16.840.1.113883.10.20.22.4.13',-1,'Procedure Activity Observation',3,'This clinical statement represents procedures that result in new information about the patient that cannot be classified as a procedure according to the HL7 RIM.  Examples of these procedures are diagnostic imaging procedures, EEGs and EKGs.','cons, procedure',64,NULL,NULL,'2011-04-07 15:07:02','defaultUser'),(731,'2.16.840.1.113883.10.20.22.1.3',-1,'History and Physical',1,'A History and Physical (H&P) Note is a medical report that documents the current and past conditions of the patient.  It contains essential  information that helps determine an individual\'s health status. \r\n\r\nThe first portion of the report is a current collection of organized information unique to an individual, typically supplied by the patient or their caregiver, about the current medical problem or the reason for the patient encounter.  This information is followed by a description of any past or ongoing medical issues, including current medications and allergies.  Information is also obtained about the patient\'s lifestyle, habits, and diseases among family members.\r\n\r\nThe next portion of the report contains information obtained by physically examining the patient and gathering diagnostic information in the form of laboratory tests, imaging, or other diagnostic procedures.  \r\n\r\nThe report ends with the clinician\'s assessment of the patient\'s situation and the intended plan to address those issues. \r\n\r\nA History and Physical Examination is required upon hospital admission as well as before operative procedures.  An initial evaluation in an ambulatory setting is often documented in the form of an H&P Note.',NULL,28,599,NULL,'2011-04-08 00:32:36','defaultUser'),(734,'2.16.840.1.113883.10.20.22.1.4',-1,'Consult Note',1,'For the purpose of this Implementation Guide, a consultation visit is defined by the evaluation and management guidelines for a consultation established by the Centers for Medicare and Medicaid Services (CMS).  According to those guidelines, a Consultation Note must be generated as a result of a physician or nonphysician practitionerâ€™s (NPP) request for an opinion or advice from another physician or NPP. Consultations must involve face-to-face time with the patient or fall under guidelines for telemedicine visits.  \r\n\r\nA Consultation Note must be provided to the referring physician or NPP and must include the reason for the referral, history of present illness, physical examination, and decision-making component (Assessment and Plan). \r\nAn NPP is defined as any licensed medical professional as recognized by the state in which the professional practices, including, but not limited to, physician assistants, nurse practitioners, clinical nurse specialists, social workers, physical therapists, and speech therapists.\r\n\r\nReports on visits requested by a patient, family member, or other third party are not covered by this specification.  Second opinions, sometimes called â€œconfirmatory consultations,â€� also are not covered here. Any question on use of the Consultation Note defined here should be resolved by reference to CMS or AMA guidelines.',NULL,28,599,NULL,'2011-04-07 21:32:55','defaultUser');
